const StaticCheckbox = () =>{
    return(
        <div>
            <div>
                <label>
                    <input
                        type='checkbox'
                    />Simultaneous
                </label> 
                <label>
                    <input
                        type='checkbox'
                    />Not Simultaneous
                </label> 
            </div>
            

        </div>
        
    );
}

export default StaticCheckbox;
